import React from "react";
import "./Home.css";

import { stockData } from "../Data";

class Home extends React.Component {
  render() {
    return (
          <div>       
            {stockData.map((data, key) => {
              return (
                <div className="stock-container">
                <div key={key}>
                  {data.company +
                    " , " +
                    data.ticker +
                    " ," +
                    data.stockPrice +
                    ", " +
                    data.timeElapsed}
                    <button>add to cart</button>
                    </div>
                </div>
              );

            })}
              <div  className="cart">empty cart</div>

          </div>


    );
  }
}

export default Home;
